import React from "react";
import CourseBox from "./CourseBox";
import "./CourseHistory.css";

const CourseHistory = () => {
  return (
    <div>
      <h1 align="center">
        <div className="major">
          <CourseBox
            className="major"
            height="500px"
            title="Major (Completed)"
          />
        </div>
        <div>
          <CourseBox height="450px" title="Support (Completed)" />
        </div>
      </h1>
    </div>
  );
};

export default CourseHistory;
